description:
Before there was Red vs. Blue, there was PROJECT FREELANCER...

This is my own cut and rendered video containing footage from ONLY Project Freelancer (from both Seasons 9 and 10 Bluray).  I created it in order to watch the entire story of Project Freelancer uninterrupted, and ensured that the quality was equal to Bluray, even after rendering and compression.  Hope you enjoy it as much as I have!


